import { Container } from 'react-bootstrap';
import 'react-calendar/dist/Calendar.css';
import Calendars from './component/Calendars';
import styled from 'styled-components';

function App() {
  return (
    <div className="App">
      <Container>
        <Calendars />
      </Container>
    </div>
  );
}

export default App;
